import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { Users, Calendar, CreditCard } from 'lucide-react';

const Dashboard = () => {
  const navigate = useNavigate();
  const [stats, setStats] = useState({
    totalClients: 0,
    todayAppointments: 0,
    monthlyRevenue: 0,
    isLoading: true
  });

  // Dashboard kartları
  const dashboardCards = [
    {
      label: 'Clients',
      icon: Users,
      path: '/customers',
      color: 'bg-rose-100',
      iconColor: 'text-rose-600'
    },
    {
      label: 'Appointments',
      icon: Calendar,
      path: '/appointments',
      color: 'bg-blue-100',
      iconColor: 'text-blue-600'
    },
    {
      label: 'Payments',
      icon: CreditCard,
      path: '/payments',
      color: 'bg-green-100',
      iconColor: 'text-green-600'
    }
  ];

  const DashboardCard = ({ label, icon: Icon, onClick, color, iconColor }) => (
    <div 
      onClick={onClick}
      className={`${color} rounded-lg shadow-sm p-8 cursor-pointer hover:shadow-md transition-all duration-200 hover:scale-[1.02] border border-gray-200`}
    >
      <div className="flex flex-col items-center space-y-4">
        <div className="w-16 h-16 bg-white rounded-full flex items-center justify-center shadow-sm">
          <Icon className={`h-8 w-8 ${iconColor}`} />
        </div>
        <h3 className="text-xl font-semibold text-gray-900">{label}</h3>
      </div>
    </div>
  );

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Header */}
      <header className="bg-white shadow-sm border-b border-gray-200">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex justify-between items-center h-16">
            <h1 className="text-2xl font-bold text-gray-900">Beauty Salon</h1>
            <div className="flex items-center space-x-4">
              <span className="text-gray-600">Admin</span>
              <button className="px-4 py-2 text-gray-600 hover:text-gray-900 transition-colors">
                Log Out
              </button>
            </div>
          </div>
        </div>
      </header>

      {/* Main Content */}
      <main className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
        <div className="mb-8">
          <h2 className="text-3xl font-bold text-gray-900 mb-2">Dashboard</h2>
          <p className="text-gray-600">Manage your beauty salon operations</p>
        </div>

        {/* Dashboard Cards */}
        <div className="grid grid-cols-1 md:grid-cols-3 gap-6 max-w-4xl mx-auto">
          {dashboardCards.map((card, index) => (
            <DashboardCard
              key={index}
              label={card.label}
              icon={card.icon}
              onClick={() => navigate(card.path)}
              color={card.color}
              iconColor={card.iconColor}
            />
          ))}
        </div>

        {/* Quick Stats - Opsiyonel */}
        {!stats.isLoading && (
          <div className="mt-12 grid grid-cols-1 md:grid-cols-3 gap-6 max-w-4xl mx-auto">
            <div className="bg-white rounded-lg shadow-sm p-6 border border-gray-200">
              <div className="flex items-center">
                <Users className="h-8 w-8 text-rose-600" />
                <div className="ml-4">
                  <p className="text-sm font-medium text-gray-600">Total Clients</p>
                  <p className="text-2xl font-bold text-gray-900">{stats.totalClients}</p>
                </div>
              </div>
            </div>
            <div className="bg-white rounded-lg shadow-sm p-6 border border-gray-200">
              <div className="flex items-center">
                <Calendar className="h-8 w-8 text-blue-600" />
                <div className="ml-4">
                  <p className="text-sm font-medium text-gray-600">Today's Appointments</p>
                  <p className="text-2xl font-bold text-gray-900">{stats.todayAppointments}</p>
                </div>
              </div>
            </div>
            <div className="bg-white rounded-lg shadow-sm p-6 border border-gray-200">
              <div className="flex items-center">
                <CreditCard className="h-8 w-8 text-green-600" />
                <div className="ml-4">
                  <p className="text-sm font-medium text-gray-600">Monthly Revenue</p>
                  <p className="text-2xl font-bold text-gray-900">₺{stats.monthlyRevenue.toLocaleString('tr-TR')}</p>
                </div>
              </div>
            </div>
          </div>
        )}
      </main>
    </div>
  );
};

export default Dashboard;
